import React from 'react';

import { Link } from 'react-router-dom';



const Navbar = props = (
        <header>
            <nav id="menu" >
                <ul>
                    <li><Link to="/portfolio" className="menu-links"></Link></li>
                    <Link to="/projects" className="menu-links" data-menuanchor="about">About</Link>
                    <Link to="/contact" className="menu-links" data-menuanchor="about">About</Link>                
                </ul>
            </nav>
        </header>
)
